def copyanything(src, dst,ignore=None):
    try:
        if ignore: shutil.copytree(src, dst, dirs_exist_ok=True, ignore=shutil.ignore_patterns(ignore))
        else: shutil.copytree(src, dst, dirs_exist_ok=True)
    except OSError as exc: # python >2.5
        if exc.errno in (errno.ENOTDIR, errno.EINVAL):
            shutil.copy(src, dst)
        else: raise






